importScripts(`hashes.min.js`);onmessage=e=>{const [u,r,m]=e.data,s=new WebSocket(`wss://magi.duinocoin.com:8443/`);s.onmessage=e=>{if(e.data.startsWith(`3.`)||e.data===`GOOD\n`||e.data===`BAD\n`){s.send(`JOB,${u},LOW${m!==null?`,`+m:``}`);}else{const j=e.data.split(`,`),st=performance.now();for(let re=0;re<100*j[2]+1;re++){if(j[1]===new Hashes.SHA1().hex(j[0]+re)){s.send(`${re},${(re*1000/(performance.now()-st)).toFixed(2)},Duino-JS v4.1 by sys-256,${r}`);break}}}}}